import styled from "styled-components";

const Note = styled.div`
  text-decoration: none;
  color: #000;
  background: #ffc;
  display: block;
  height: 10em;
  width: 10em;
  padding: 1em;
`;

const Ticket = () => {
  return (
    <div>
      <Note>Ticket</Note>;
    </div>
  );
};

export default Ticket;
